@get_func_time
def length_longest_substring6(s):
    ans = 0
    start = 0
    end = 0
    str_set = set()
    while start < len(s) and end < len(s):
        str_len = len(str_set)
        str_set.add(s[end])
        if str_len != len(str_set):
            end += 1
            ans = max(ans, end - start)
        else:
            str_set.remove(s[start])
            start += 1
    return ans


